// Function to show the password prompt
function showPasswordPrompt(callback) {
  // Create modal elements
  const modal = document.createElement('div');
  const overlay = document.createElement('div');
  const message = document.createElement('div');
  const input = document.createElement('input');
  const submitButton = document.createElement('button');
  const cancelButton = document.createElement('button');

  // Set attributes and styles
  modal.style.position = 'fixed';
  modal.style.left = '50%';
  modal.style.top = '50%';
  modal.style.transform = 'translate(-50%, -50%)';
  modal.style.padding = '20px';
  modal.style.backgroundColor = 'white';
  modal.style.zIndex = '1000';
  modal.style.borderRadius = '8px';
  modal.style.boxShadow = '0 4px 8px rgba(0, 0, 0, 0.2)';

  overlay.style.position = 'fixed';
  overlay.style.top = '0';
  overlay.style.left = '0';
  overlay.style.width = '100%';
  overlay.style.height = '100%';
  overlay.style.backgroundColor = 'rgba(0, 0, 0, 0.5)';
  overlay.style.zIndex = '999';

  // Message above input
  message.textContent = 'Please enter the password';
  message.style.marginBottom = '10px';
  message.style.fontSize = '16px';
  message.style.fontWeight = 'bold';

  // Input field
  input.type = 'password';
  input.placeholder = 'Enter password';
  input.style.padding = '10px';
  input.style.width = '100%';
  input.style.marginBottom = '10px';
  input.style.borderRadius = '4px';
  input.style.border = '1px solid #ccc';

  // Buttons
  submitButton.textContent = 'Submit';
  cancelButton.textContent = 'Cancel';
  [submitButton, cancelButton].forEach(button => {
    button.style.padding = '10px 20px';
    button.style.marginRight = '10px';
    button.style.borderRadius = '4px';
    button.style.border = 'none';
    button.style.cursor = 'pointer';
    button.style.transition = 'background-color 0.3s';
  });

  // Button styles
  submitButton.style.backgroundColor = '#4CAF50'; // Green
  cancelButton.style.backgroundColor = '#f44336'; // Red

  // Change button color on click
  submitButton.addEventListener('mousedown', () => {
    submitButton.style.backgroundColor = '#45a049'; // Darker green
  });
  submitButton.addEventListener('mouseup', () => {
    submitButton.style.backgroundColor = '#4CAF50';
  });

  cancelButton.addEventListener('mousedown', () => {
    cancelButton.style.backgroundColor = '#e53935'; // Darker red
  });
  cancelButton.addEventListener('mouseup', () => {
    cancelButton.style.backgroundColor = '#f44336';
  });

  modal.appendChild(message);
  modal.appendChild(input);
  modal.appendChild(submitButton);
  modal.appendChild(cancelButton);
  document.body.appendChild(overlay);
  document.body.appendChild(modal);

  // Event listeners
  submitButton.addEventListener('click', () => {
    const password = input.value;
    if (password !== "iplon321") {
      context.grafana.notifyError(["Error", "Incorrect password. Update not allowed."]);
      return;
    } else {
      // Password is correct; proceed with your logic
      console.log("Password accepted!");
      // Clean up
      document.body.removeChild(modal);
      document.body.removeChild(overlay);
      callback(); // Call the next function to execute after password validation
    }
  });
  input.addEventListener('keydown', (event) => {
    if (event.key === 'Enter') {
      submitButton.click(); // Trigger the submit button click
    }
    if (event.key === 'Escape') {
      cancelButton.click(); // Trigger the cancel button click
    }
  });
  cancelButton.addEventListener('click', () => {
    // Clean up
    document.body.removeChild(modal);
    document.body.removeChild(overlay);
  });
}



